import{_ as e,c as t,o as n,a9 as s}from"./chunks/framework.DmNUfcqR.js";const C=JSON.parse('{"title":"Кодировки Символов в JSSC","description":"","frontmatter":{},"headers":[],"relativePath":"ru/internals/encodings/index.md","filePath":"ru/internals/encodings/index.md","lastUpdated":1768715214000}'),r={name:"ru/internals/encodings/index.md"};function i(d,o,c,l,S,a){return n(),t("div",null,[...o[0]||(o[0]=[s('<h1 id="кодировки-символов-в-jssc" tabindex="-1">Кодировки Символов в JSSC <a class="header-anchor" href="#кодировки-символов-в-jssc" aria-label="Permalink to &quot;Кодировки Символов в JSSC&quot;">​</a></h1><p>JSSC использует свои <strong>внутренние кодировки символов</strong> как часть алгоритма сжатия.</p><p>Данные кодировки <strong>не относятся</strong> к ASCII, UTF-8, UTF-16, Windows-125x, ISO-8859 или к любым другим системным или платформенным кодировкам.</p><p>Они существуют <strong>только внутри JSSC</strong> и используются для оптимизации сжатия для многих языков (только для самых популярных).</p><p>Кодировки Символов используются <strong>Режимом Сжатия <code>05</code> — «Кодировка Символов»</strong>. Существует всего <strong>15 Кодировок Символов</strong> для <strong>23 языков</strong>.</p><h2 id="список-кодировок-символов-в-jssc" tabindex="-1">Список Кодировок Символов в JSSC <a class="header-anchor" href="#список-кодировок-символов-в-jssc" aria-label="Permalink to &quot;Список Кодировок Символов в JSSC&quot;">​</a></h2><ul><li><code>00</code> <strong>JSSCBASE</strong> — Нет языков - Пунктуация, числа, валюты и символы</li><li><code>01</code> <strong>JSSCRU</strong> — Русский, Украинский, Белорусский, Казахский</li><li><code>02</code> <strong>JSSCENRU</strong> — Английский, Русский, Украинский, Белорусский</li><li><code>03</code> <strong>JSSCENKK</strong> — Английский, Русский, Казахский</li><li><code>04</code> <strong>JSSCHI</strong> — Хинди</li><li><code>05</code> <strong>JSSCENHI</strong> — Английский, Хинди</li><li><code>06</code> <strong>JSSCBN</strong> — Бенгальский</li><li><code>07</code> <strong>JSSCENBN</strong> — Английский, Бенгальский</li><li><code>08</code> <strong>JSSCHIBN</strong> — Хинди, Бенгальский</li><li><code>09</code> <strong>JSSCJA</strong> — Английский, Японский (Хирагана и Катакана)</li><li><code>10</code> <strong>JSSCTelu</strong> — Английский, Телугу</li><li><code>11</code> <strong>JSSCMR</strong> — Английский, Маратхи</li><li><code>12</code> <strong>JSSCB</strong> — <em>«Балтика»</em> - Латышский, Литовский, Эстонский, Польский, Чешский, Словацкий</li><li><code>13</code> <strong>JSSCE</strong> — <em>«Европейский»</em> - Английский, Французский, Немецкий, Испанский, Португальский, Итальянский, Нидерландский</li><li><code>14</code> <strong>JSSCAR</strong> — Арабский</li></ul>',7)])])}const J=e(r,[["render",i]]);export{C as __pageData,J as default};
